import React, { useState } from 'react';
import { Search, MapPin, Star, Filter, Clock, Camera, Thermometer } from 'lucide-react';

const SpaceCard = ({ space, onFavorite, isFavorite, onReserve, reservations }) => {
  const [isReserving, setIsReserving] = useState(false);
  const [reservationDates, setReservationDates] = useState({
    startDate: '',
    endDate: ''
  });

  const handleReservationSubmit = () => {
    const { startDate, endDate } = reservationDates;

    if (!startDate || !endDate) {
      alert('Por favor selecciona las fechas de inicio y fin.');
      return;
    }

    const start = new Date(startDate);
    const end = new Date(endDate);

    if (start >= end) {
      alert('La fecha de fin debe ser posterior a la fecha de inicio.');
      return;
    }

    const isConflict = reservations.some(reservation => {
      const reserveStart = new Date(reservation.startDate);
      const reserveEnd = new Date(reservation.endDate);
      return (start <= reserveEnd && end >= reserveStart) &&
             reservation.spaceId === space.id;
    });

    if (isConflict) {
      alert('Este espacio ya está reservado en las fechas seleccionadas.');
      return;
    }

    onReserve(space.id, startDate, endDate);
    setIsReserving(false);
    setReservationDates({ startDate: '', endDate: '' });
  };

  // Amenities tags based on space type
  const getAmenities = (type) => {
    const baseAmenities = ['24/7 Access', 'Security Camera', 'Climate Control'];
    if (type === 'garage') {
      return [...baseAmenities, 'Vehicle Storage'];
    } else if (type === 'almacen') {
      return [...baseAmenities, 'Shelving Units'];
    }
    return baseAmenities;
  };

  return (
    <div className="bg-white rounded-xl shadow-sm overflow-hidden hover:shadow-md transition">
      <img
        src={space.image || `/api/placeholder/400/250?text=${encodeURIComponent(space.name)}`}
        alt={space.name}
        className="w-full h-48 object-cover"
      />
      <div className="p-4">
        <div className="flex justify-between items-start">
          <div>
            <h3 className="font-semibold text-lg">{space.name}</h3>
            <p className="text-gray-500 mt-1">
              <MapPin className="w-4 h-4 inline mr-1" />
              {space.location}
            </p>
          </div>
          <div className="flex items-center">
            <Star className="w-4 h-4 text-orange-500" />
            <span className="ml-1">{space.rating}</span>
            <span className="text-gray-500 text-sm ml-1">(120)</span>
          </div>
        </div>

        <div className="mt-2 flex flex-wrap gap-2">
          {getAmenities(space.type).map((amenity, index) => (
            <span key={index} className="text-xs bg-gray-100 px-2 py-1 rounded-full text-gray-600">
              {amenity}
            </span>
          ))}
        </div>

        {isReserving ? (
          <div className="mt-4 space-y-3">
            <div className="flex gap-2">
              <div className="flex-1">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Inicio
                </label>
                <input
                  type="date"
                  className="w-full p-2 border rounded-lg"
                  value={reservationDates.startDate}
                  onChange={(e) => setReservationDates({
                    ...reservationDates,
                    startDate: e.target.value
                  })}
                />
              </div>
              <div className="flex-1">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Fin
                </label>
                <input
                  type="date"
                  className="w-full p-2 border rounded-lg"
                  value={reservationDates.endDate}
                  onChange={(e) => setReservationDates({
                    ...reservationDates,
                    endDate: e.target.value
                  })}
                />
              </div>
            </div>
            <div className="flex gap-2">
              <button
                onClick={handleReservationSubmit}
                className="flex-1 bg-orange-500 text-white py-2 rounded-lg hover:bg-orange-600 transition-colors"
              >
                Confirmar
              </button>
              <button
                onClick={() => setIsReserving(false)}
                className="flex-1 bg-gray-200 text-gray-800 py-2 rounded-lg hover:bg-gray-300 transition-colors"
              >
                Cancelar
              </button>
            </div>
          </div>
        ) : (
          <div className="mt-4 flex justify-between items-center">
            <p className="text-lg font-semibold">${space.price}/día</p>
            <button
              onClick={() => setIsReserving(true)}
              className="px-4 py-2 bg-orange-500 text-white rounded-lg hover:bg-orange-600 transition-colors"
            >
              Reservar
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

const HomePage = ({ spaces, onFavorite, favorites, onReserve, reservations }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [activeFilter, setActiveFilter] = useState('all');

  const filterSpaces = () => {
    return spaces.filter(space => {
      const matchesSearch = space.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                          space.location.toLowerCase().includes(searchTerm.toLowerCase());
      const matchesFilter = activeFilter === 'all' || space.type === activeFilter;
      return matchesSearch && matchesFilter;
    });
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Search Section */}
      <div className="bg-orange-500 py-8">
        <div className="max-w-3xl mx-auto px-4">
          <div className="bg-white rounded-full shadow-lg flex items-center p-2">
            <Search className="text-gray-400 ml-2" />
            <input
              type="text"
              placeholder="Buscar garajes por ubicación..."
              className="w-full px-4 py-2 outline-none"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button className="bg-orange-500 text-white px-6 py-2 rounded-full hover:bg-orange-600 transition-colors">
              Buscar
            </button>
          </div>
        </div>
      </div>

      {/* Filters */}
      <div className="max-w-7xl mx-auto px-4 py-4">
        <div className="flex space-x-4 overflow-x-auto">
          <button
            className={`flex items-center px-4 py-2 rounded-full border hover:bg-gray-50 
              ${activeFilter === 'all' ? 'bg-orange-100 border-orange-500 text-orange-500' : ''}`}
            onClick={() => setActiveFilter('all')}
          >
            <Filter className="w-4 h-4 mr-2" />
            Todos los filtros
          </button>
          <button
            className={`flex items-center px-4 py-2 rounded-full border hover:bg-gray-50
              ${activeFilter === 'garage' ? 'bg-orange-100 border-orange-500 text-orange-500' : ''}`}
            onClick={() => setActiveFilter('garage')}
          >
            Garajes
          </button>
          <button
            className={`flex items-center px-4 py-2 rounded-full border hover:bg-gray-50
              ${activeFilter === 'almacen' ? 'bg-orange-100 border-orange-500 text-orange-500' : ''}`}
            onClick={() => setActiveFilter('almacen')}
          >
            Almacenes
          </button>
          <button className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50">
            <Clock className="w-4 h-4 mr-2" />
            Disponibilidad
          </button>
          <button className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50">
            <Camera className="w-4 h-4 mr-2" />
            Seguridad
          </button>
          <button className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50">
            <Thermometer className="w-4 h-4 mr-2" />
            Clima
          </button>
        </div>
      </div>

      {/* Results Grid */}
      <div className="max-w-7xl mx-auto px-4 py-8">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filterSpaces().map(space => (
            <SpaceCard
              key={space.id}
              space={space}
              onFavorite={onFavorite}
              isFavorite={favorites.includes(space.id)}
              onReserve={onReserve}
              reservations={reservations}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
